var React = require('react');

class Register extends React.Component {
   constructor() {
       super()
       this.state = {
           username: '',
           password: '',
           location: '',
           photo: '',
           food: '',
           gender: '',
       }
   }


   handleSubmit(e,v) {
       e.preventDefault();
       fetch('/register', {
           method: 'POST',
           headers: {
                'Content-Type': 'application/json',
                // 'Content-Type': 'application/x-www-form-urlencoded',
            },
            body: JSON.stringify({
                username: this.s
            })
       })
   }



    render(){
        return (
             <html>
            <head>
                <meta charset="UTF-8"/>
                <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous"/>
                <link rel="stylesheet" type="text/css" href="/registerstyle.css"/>
                <title>Registration Form</title>
            </head>
            <body>
                <h1>Registration</h1>
                <br/>
                <div className="container">
                <form onSubmit={this.handleSubmit}>
                    Enter username <input name="username" className="form-control" onChange={this.handleChange}/><br/>
                    Enter password <input name="password" className="form-control" onChange={this.handleChange}/><br/>
                    Enter location <input name="location" className="form-control" onChange={this.handleChange}/><br/>
                    Enter photo <input name="photo" className="form-control" onChange={this.handleChange}/><br/>
                    Enter food <input name="food" className="form-control" onChange={this.handleChange}/><br/><br/>
                    Enter gender <input name="gender" className="form-control" onChange={this.handleChange}/><br/><br/>
                    <input id="createAcc" type="submit" className="btn btn-primary" value="Create Account"/>
                </form>
                </div>
            </body>
        </html>);
    }
}

export default Register;
